import { Button, Cascader, Form, Input, Select, TreeSelect } from "antd";

const TaskForm = () => {
  let PriorityOptions = [
    { 1: "One" },
    { 2: "Two" },
    { 3: "Three" },
  ];
  let StatusOptions = [
    { 1: "New" },
    { 2: "In Progress" },
    { 3: "Complete" },
    { value: "Discarded" },
  ];

  return (
    <>
      <h1>TODO - APP</h1>
      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        style={{
          maxWidth: 600,
        }}
      >
        <Form.Item label="Task">
          <Input />
        </Form.Item>
        <Form.Item label="Priority">
          <Select options={PriorityOptions} />
        </Form.Item>
        <Form.Item label="Status">
          <Select></Select>
        </Form.Item>
        <Form.Item label="Cascader">
          <Cascader
            options={[
              {
                value: "zhejiang",
                label: "Zhejiang",
                children: [
                  {
                    value: "hangzhou",
                    label: "Hangzhou",
                  },
                ],
              },
            ]}
          />
        </Form.Item>
      </Form>
    </>
  );
};
export default TaskForm;
